    const navigate = useNavigate();

    const handleUserInfoClick = () => {
        navigate(`/${user.name}/${user.email}/${user.tel}/${user.website}`)
    }
    return ( 
            <div className='user-container'>
                <div>{user.name}</div>
                <div>{user.email}</div>
              {/* Icones */}
            </div>        
     );
}

export default User;
